import React from "react";

const Collections = () => {
  return (
    <div className="page-container">
      <h1>Our Collections</h1>
      <p>
        Browse our Bridal, Everyday, and Luxury collections. Each piece is
        handcrafted with love and precision.
      </p>
    </div>
  );
};

export default Collections;
